commits.sourceNew:
@Override
public boolean equals(Object obj) {
  if (this == obj) {
    return true;
  }
  if (obj == null) {
    return false;
  }
  if (getClass() != obj.getClass()) {
    return false;
  }
  Pair other = (Pair) obj;
  if (end != other.end) {
    return false;
  }
  if (start != other.start) {
    return false;
  }
  return true;
}

